import React, { useEffect, useState } from "react";
import Car from '../components/Car.js'

function Teams() {
    const [cars, setCars] = useState([])
    const [profileData, setProfileData] = useState([])

    async function fetchUser() {
        let restURL = "http://localhost:8081/race/rest/users/current";
        await fetch(restURL, {
            method: "GET",
            credentials: 'include',
            headers: {
                mode: 'no-cors',
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
                setProfileData(data);
            })
    }
    const fetchData = () => {
        let restURL = "http://localhost:8081/race/rest/cars/getMyCars";
        fetch(restURL, {
            headers: {
                method: "GET",
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
                setCars(data)
            })
    }

    useEffect(() => {
        fetchData()
        fetchUser()
    }, [])

    let carList = [];
    cars.forEach(car => {
        carList.push(
        <Car key={car.id} data={car} user={profileData}/>
      )
    });
    return (
        <div className="Page">
            <div className="Cars">
            <a href="/newCar">NEW TEAM</a>
            </div>
        </div>
    );
}

export default Teams;
